import React from "react";

const SkillIcon = ({src, caption}) => (
  <div className="skill-icon-wrapper">
    <img className="skill-icon-image" src={src} alt={caption} />
    <p className="skill-icon-caption">
      {caption}
    </p>
  </div>
);

export default SkillIcon;
